import { cardData } from "../utils/mockData";
import {Card,QuoteIcon,Container,Content,Image,Name} from './styles';

const ClientSlide=() =>{
return (
    <Container>
        {cardData.map((card,index) => 
              <Card key={index}>
             <Image src={card.Image} alt="card"/>
             <Content>
             <QuoteIcon src={card.quoteIcon} alt="Icon"/>
             <p>{card.para}</p>
             <Name style={"margin:0"}>{card.name}</Name>
             <h4 style={"margin:0"}>{card.title}</h4>
             </Content>
             </Card>
            )
        }      
</Container>
)
}
export default ClientSlide;
